const convertCamel = function (varNames) {
  const initial = varNames.trim().toLowerCase();
  const converted = initial.slice(initial.indexOf('_')).replace('_', '');
  const capitalize = converted.replace(
    converted[0],
    converted[0].toUpperCase()
  );

  const camaled = initial.slice(0, initial.indexOf('_')) + capitalize;
  const ticks = '✅'.repeat(converted.length); // Add green ticks based on the length of the converted variable name
  return `${camaled}${ticks}`;
};

console.log(convertCamel('underscore_case'));
console.log(convertCamel('first_name'));
console.log(convertCamel('Some_Variable'));
console.log(convertCamel(' calculate_AGE'));
console.log(convertCamel('delayed_departure'));

#Python parser and runner for ghostmouse-recordings (https://www.ghost-mouse.com/)

import typing
import re, time, win32api, win32con

class CommandBase:
	def __call__(self):
		pass

class DelayCommand(CommandBase):
	def __init__(self, delay: float) -> None:
		self._delay = delay
	def __call__(self):
		time.sleep(self._delay)

class MouseMoveCommand(CommandBase):
	def __init__(self, x: int, y: int) -> None:
		self._x, self._y = x, y
	def __call__(self):
		win32api.SetCursorPos((self._x, self._y))

class MouseButtonCommand(CommandBase):
	def __init__(self, x: int, y: int, btn: str, up: bool) -> None:
		self._x, self._y = x, y
		if btn == 'L':
			if up: self._e = win32con.MOUSEEVENTF_LEFTUP
			else: self._e = win32con.MOUSEEVENTF_LEFTDOWN
		elif btn == 'R':
			if up: self._e = win32con.MOUSEEVENTF_RIGHTUP
			else: self._e = win32con.MOUSEEVENTF_RIGHTDOWN
		elif btn == 'M':
			if up: self._e = win32con.MOUSEEVENTF_MIDDLEUP
			else: self._e = win32con.MOUSEEVENTF_MIDDLEDOWN
		else:
			raise ValueError('unknown mouse button: ' + self._btn)
	def __call__(self):
		win32api.mouse_event(self._e,self._x,self._y,0,0)

def load(filename: str) -> typing.List[CommandBase]:
	commands = []
	for line in open(filename, 'r'):
		cmd = re.findall('\\{Delay ([0-9\\.]+)\\}', line)
		if len(cmd) > 0:
			cmd = float(cmd[0])
			commands.append(DelayCommand(cmd))
		else:
			cmd = re.findall('\\{Move \\(([0-9]+),([0-9]+)\\)\\}', line)
			if len(cmd) > 0:
				cmd = cmd[0]
				x,y=int(cmd[0]),int(cmd[1])
				commands.append(MouseMoveCommand(x,y))
			else:
				cmd = re.findall('\\{([LRM])Mouse ((?:up|down)) \\(([0-9]+),([0-9]+)\\)\\}', line)
				if len(cmd) > 0:
					cmd = cmd[0]
					x,y=int(cmd[2]),int(cmd[3])
					commands.append(MouseButtonCommand(x,y,cmd[0], cmd[1] == 'up'))
				else:
					raise ValueError('unknown command: ' + line)
	return commands

def execute(commands: typing.List[CommandBase]) -> None:
	for command in commands: command()

