#include <stdio.h>

void swap(int* a, int* b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

// Функция сортировки только четных элементов, игнорируя нечетные
void sort_even_only(int* arr, int n) {
    // пузырьком.........
    for (int i = 0; i < n - 1; i++) {
        if (arr[i] % 2 == 0) {
            // Находим следующий четный элемент для возможного обмена
            for (int j = i + 1; j < n; j++) {
                if (arr[j] % 2 == 0) {
                    // Сравниваем и обмениваем четные элементы, если необходимо
                    if (arr[i] > arr[j]) {
                        swap(&arr[i], &arr[j]);
                    }
                }
            }
        }
    }
}

void print_array(const int* arr, int n) {
    for (int i = 0; i < n; i++) {
        printf("%d ", arr[i]);
    }
    printf("\n");
}

int main() {
    int array[] = { 5, 10, 8, 3, 6, 12 };
    int length = sizeof(array) / sizeof(array[0]);

    sort_even_only(array, length);
    print_array(array, length);

    return 0;
}

