       numcipher[i]=numstr[i]+numkey[i];
   }
   for(i=0; i<strlen(str); i++)
   {
       if(numcipher[i]>25)
       {
           numcipher[i]=numcipher[i]-26;
       }
   }
   printf("Vigenere Cipher text is\n");
